import "./App.css";
import CountryComponent from "./components/CountryComponent";
import { CountryProvider } from "./contexts/CountryContext";
import { CityProvider } from "./contexts/CityContext";
function App() {
  return (
    <div className="App">
      <CountryProvider>
        <CountryComponent />
      </CountryProvider>
      <CityProvider></CityProvider>
    </div>
  );
}

export default App;
